import axios from 'axios'
import React, { useEffect, useState } from 'react'
import { Link, useNavigate, useParams } from 'react-router-dom'
import styles from './index.module.css'

function Index() {
  const navigate = useNavigate()
  let id = useParams()
  let [products, setProducts] = useState([])
  let [search, setSearch] = useState('')
  useEffect(() => {
    axios.get('http://localhost:8080/NFTs').then((res) => {
   
        let filter = res.data.filter((x) => {
          return x.name.toLowerCase().includes(search.toLowerCase())
        })
        setProducts(filter)
      
    })
  }, [ products])
  return (
    <div>
         <img 
         src='data:image/png;base64,'
         alt=''></img>
      {
        
        <div className={styles.headerWrap}> 
    
          <div className={styles.homeContainer}>
      
            {products.map((product) => {
              return (
                <div>
                <ol className={styles.main} type="1">
                  <li key={product.id} className={styles.card}>
                  <img
                  className={styles.nftimage}
                  style={{}}
                  src={product.nftimg}
                  alt=""
                />
                   
                    <h4 className={styles.name}>
                    {product.name}{' '}
                    </h4>
                    <div style={{display:'flex',flexDirection:'row'}}>
                    <div className={styles.img}>
                  
                    <img
                      style={{ width: '190px', height: '100%' }}
                      src={product.userimg}
                      alt=""
                    />
                  </div>
                <p className={styles.userName}>
                {product.username}
                  </p>
                  </div>
                
                    
                    <p className={styles.priceword} style={{color:'#858584'}}>Price</p>
                   
                
                    <p className={styles.price}>
                      
                       {product.price}
                    </p>
                    <div>
                    <p className={styles.highestbidword}>Highest Bid</p>
                    <p className={styles.highestbid}>
                    {product.highestBid}
                    </p>
                    </div>
                   
                  </li>
                  </ol>
                </div>
              )
            })}
          </div>
        </div>
      }
    </div>
  )
}

export default Index
